import React from 'react';
import Login from './Components/Signup';
import Signup from './Components/Login';
import Overlays from './Components/Overlays';
import './index.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
          <Login />
          <Signup />
          <Overlays />
      </div>
    </div>
  );
}

export default App;
